function Card(props) {
  return (
    <template id="cards">
                <div className="element" key={props._id}>
                    <img src="#" className="element__image" alt={props.name} style={{ backgroundImage: `url(${props.link})` }} />
                    <div className="element__item">
                        <p className="element__title" name="name">{props.name}</p>
                        <button className="element__delete"></button>
                        <div className="element__likes-and-number">
                            <button className="element__like"></button>
                            {/* <span className="element__like-number">{card.likes.length}</span> */}
                        </div>
                    </div>
                </div>
            </template>
  )
}

export default Card;
